            sentence.append(f"{airport} has an elevation of {triple.object} meters.")
        elif triple.predicate == "location":
            sentence.append(f"{airport} is located in {triple.object}.")
        elif triple.predicate == "runwayLength":
            sentence.append(f"Its runway length is {triple.object} meters.")
        elif triple.predicate == "1stRunwayLengthFeet":
            sentence.append(f"The first runway length is {triple.object} feet.")
        elif triple.predicate == "iataLocationIdentifier":
            sentence.append(f"The IATA identifier is {triple.object}.")
        elif triple.predicate == "nativeName":
            sentence.append(f"It is also known as {triple.object}.")
        elif triple.predicate == "capital":
            sentence.append(f"The capital of {triple.subject} is {triple.object}.")
        elif triple.predicate == "officialLanguage":
            sentence.append(f"The official language is {triple.object}.")
        elif triple.predicate == "largestCity":
            sentence.append(f"The largest city is {triple.object}.")

